const Footer = () => {
    return (
      <footer className="footer">
        <div className="footer__content">
          <div className="footer__copyright">Next.js powered site with a <a href="https://snipcart.com/">Snipcart</a> powered store</div>
          <div className="footer__socials"><a href="https://twitter.com/snipcart">Twitter</a> | <a href="https://www.facebook.com/Snipcart/">Facebook</a> | <a href="https://www.github.com/snipcart/snipcart-nextjs-seo">Github</a></div>
        </div>
      </footer>
    )
  }
  
  export default Footer;
